import React from 'react';

class Textbox extends React.Component {
    render() {
        return (
            <div className = "entry">
                <input
                    type = "text"
                    placeholder = "Input"
                    // value = {inputTerm}
                    // onChange = {changeEvent}
                />
                <button type = "submit" className = "inputButton">
                    <i> Submit </i>
                </button>
            </div>
        );
    }
}
export default Textbox;
